function startup(){console.info(settings.pagenavigatorid);let i=document.getElementById(settings.pagenavigatorid);if(i===null){console.info("No container PageNavigatorJS");return}let r=document.querySelectorAll(settings.tags);if(r.length===0){i.style.display="hidden";return}settings.generateid&&r.forEach(function(n,t){if(n.id===""){let i=`${settings.generatename}${t}`;n.id=i;console.log(i)}});let t,n="<ul>";r.forEach(function(i,r){if(i.id!==""){console.log(r);let u=parseInt(i.tagName.slice(1));if(r==1)n+=appendItem(i.id,i.innerHTML);else if(t===u)n+=appendItem(i.id,i.innerHTML);else if(u>t){let r=u-t;for(let t=0;t<r;t++)n+="<li><ul>";n+=appendItem(i.id,i.innerHTML)}else if(u<t){for(let i=0;i<t-u;i++)n+="<\/ul><\/li>";n+=appendItem(i.id,i.innerHTML)}t=u}});n+="<\/ul>";i.innerHTML+=n}function appendItem(n,t){return`<li><a href="#${n}">${t}</a></li>`}let settings={tags:"h2, h3, h4, h5, h6",pagenavigatorid:"pagenavigator",generateid:!1,generatename:"header"};document.addEventListener("DOMContentLoaded",startup());